import React from 'react';
import "./index.css"
import Card from "./Components/Cards"
import cabecalhoHeader from "./images/bg-header-desktop.svg"

function App() {
  return (

    <div>
      <header src="{cabecalhoHeader}"></header>
      <Card />
    </div>
  );
}

export default App;
